要保持渠道畅通。 [color=#FFFFFF]160.ca[/color] 前进没有容易的道路。中国正处在世界交换的心脏，这让我们处于威胁和不确定性的之中。我们需要回应与技巧，目的和信心。唯一比与中国共事更危险的，就是不与它共事。 —————————————— 原文标题：中国的间谍活动不会停止，加拿大应该纯熟应对，而非巧言令色 [color=#FFFFFF]www.iask.ca, C a n a d a M e e t[/color] China will keep spying. Canada must respond with skill, not rhetoric. [color=#FFFFFF]CanadaMeet[/color] 马大维(DAVID MULRONEY)： 2009到2012年间任加拿大驻中国大使，现于多伦多大学Munk School of Global Affairs 任高级研究员。 ; tel=新联系电话; email=新电子邮箱; post_begin_time=2014-08-24; post_end_time=2016-04-07; price=0.00; post_id=133; editsubmit=提交; }; POST={post_title=新模板-信息标题; pwd=satukx; area_title=Langley; post_text=近日，加拿大政府点名指控「一名由中国支持技术高超的黑客」攻击其国家研究委员会(NRC)。该消息一出，无疑是对近日出访北京的加拿大外交部长John Baird抛出一个烫手山芋。我们确信，他与中国方面的交流是「充分和坦率」的。而我们也可以把其中的一些坦诚用在加拿大。 这次事件并不是中国第一次针对加拿大的间谍活动，却提示我们认真地思考，如何维护这段风险和回报并不平衡的关系。 首先，我们应该无视中国道貌岸然的否认，包括中国外交部周四所指出的，加拿大缺乏「可靠的证据」证明最近有关NRC的事件与其有关。尽管中国素来强调不干涉主义，其工作原理却甚为片面。长期以来，中国的工业化发展战略都是依靠间谍作为去获取关键技术的手段之一。 [align=center][img=570,380]http://localhost/data/attachment/portal/201408/23/153010ryyrkw2yrn9zgypy.jpg[/img] [/align][align=center]前加拿大驻中国大使马大维(DAVID MULRONEY) [/align]当然，中国除了间谍，还有别的方法来达到目的。它可以随意地抗议任何对「敏感」话题表示不当兴趣的人。对达赖喇嘛、新疆地区的动荡不安和法轮功学员的困境表达过关注的加拿大的议员、市长、学者和社区领袖们，都曾因此而受到欺压。 这是不可接受的，但也正是真正困难的部分：我们将会看到更多的相同案例。一个崛起中但不安的中国为了推动自身利益，不会从秘密且完全不友好的战略中畏缩。 面对此事，我们必须保持清醒的头脑。但我们也要认识到，我们未来的繁荣、安全和幸福，都取决于我们如何有智慧地保持与中国的关系。 所以，我们要从排除那些巧言令色开始。中国不是我们最好的朋友，而是所有恐惧的总和。我们必须承认和解决，中国对我们的安全带来的威胁。 政府必须带路，但加拿大企业也要加紧脚步。首先是加强安全的意识。高层管理人员由于害怕得罪好奇的中国游客，而对带有安全意识的职员过度统治，这类轶闻已经太多了。然而这份细腻和敏感，在轮到中国招待外宾时，从未得到回报。 [color=#FFFFFF]家 园 新 闻[/color] [align=center][img=570,458]http://localhost/data/attachment/portal/201408/23/153033nrz8n8auasjn7uzn.jpg[/img] [/align]明确态度也很重要。中国官员并不害怕坦率的谈话。每当中国政府想要向渥太华发出强硬的信息，我就会被传唤到座谈接受指责。中国驻加拿大大使却时常被小心谨慎地对待。他是一位强硬而且经验丰富的专业外交官。如果我们感到愤怒，他需要感受到我们的痛苦。 我们应支持多边合作，以减少网络间谍活动。必须承认，在爱德华·斯诺登的揭露事件之后，还要做大量的工作来弥补不同思想之间的鸿沟。但我们不仅仅是中立的观察者。我们应该加强与美国和澳大利亚等盟友的合作，打击危害我们集体安全的威胁。 我们应该避免关闭合作的大门。不幸的是，这已经发生，太平洋两岸的企业正在为此付出代价。中国的媒体将美国技术部门描绘为一个主要的安全威胁。这使得它过于热切的监管机构迅速介入，对中国的长期倾向更加明显，从而令外国公司的日子更加难过。这一周，调查人员突然